import "./autorization.module.scss";


const Autorization = () => {
    return (
        <div className="autorization">
            <h2 className="autorization__title">Авторизація</h2>
            <input className="autorization__input" type="text" placeholder="Ведіть ваш email..." />
            <input className="autorization__input" type="password" placeholder="Ведіть ваш пароль..." />
            <p className="autorization__text">Нет аккаунта? <span className="autorization__span">Зареєструватись</span></p>
            <button className="autorization__button">Увійти</button>
        </div>
    )
}
export default Autorization;
